import React, {useEffect} from 'react';
import { Link, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { updateStockData } from '../actions/stockdata';

import StockChart from './StockChart'

const Landing = ({updateStockData, stockdata: {x, y, line, loading, company}}) => {

   useEffect(() => {
      updateStockData()
   })

   return (
    <section className="landingPage">
      <h1>Hello</h1>
      {!loading && x != null && y != null && line != null ? (<StockChart x={x} y={y} line={line}/>) : (<div></div>)}
    </section>
   )
}

Landing.propTypes = {
   updateStockData: PropTypes.func.isRequired,
   stockdata: PropTypes.object.isRequired
}

const mapStateToProps = state => ({
   stockdata: state.stockdata
});

export default connect(mapStateToProps, { updateStockData })(Landing);
